const defaultState = {
    username: '',
    email: '',
    password: ''
}

export const registerReducer = (state=defaultState, action) => {
    switch (action.type) {
        case "ADD_Register":
            return {...state, username: state.username + action.payload}
        default: 
            return state
    }
}
